// data.js

function Episode(id, title, description, imageUrl) {
    return { id, title, description, imageUrl };
  }
  
  function Podcast(id, title, description, imageUrl, episodes) {
    return { id, title, description, imageUrl, episodes };
  }
  
  const episodesData = [
    Episode(1, 'Episode 1', 'Description of Episode 1', 'url_de_votre_image_1'),
    Episode(2, 'Episode 2', 'Description of Episode 1', 'url_de_votre_image_1'),
    // Autres épisodes
  ];
  
  const podcastsData = [
    Podcast(1, 'Podcast 1', 'Description of Podcast 1', 'url_de_votre_image_2', [episodesData[0]]),
    // Autres podcasts
  ];
  
  export { episodesData, podcastsData };
